const mockVisaStatus = {
  optReceipt: 'approved',
  optEad: 'rejected',
  i983: 'unsubmitted',
  i20: 'unsubmitted',
  feedback: 'Your OPT Receipt has been approved. Please upload your OPT EAD.',
};

export const fetchVisaStatus = async () => {
  await new Promise(resolve => setTimeout(resolve, 1000));
  return { visa: mockVisaStatus };
};
